import React from "react";

class Menue extends React.Component {
  constructor() {
    super();
    this.state = {
      all: {},
      name1: {}
    };
  }

  componentDidMount() {
    fetch(
      "https://raw.githubusercontent.com/openfootball/football.json/master/2018-19/en.1.json"
    )
      .then(response => response.json())
      .then(data =>{
           this.setState({
            all:data.matches,
